  [181]={ID=181,Key="des_skill_card_21_nirvana",Cn="投掷燃烧瓶，对被命中的敌人造成<color=\"\"#1ba954\"\">{0}%%</color>攻击力的伤害，并对其造成持续伤害",En="\"Throw Molotov cocktails dealing <color=\"\"#1ba954\"\">{0}%%</color> damage and causing damage over time.\"",},
  [182]={ID=182,Key="des_skill_card_3_nirvana",Cn="冰冻喷雾冻住目标，造成<color=\"\"#1ba954\"\">{0}%%</color>攻击力的伤害",En="\"Use a freeze spray to freeze the target dealing <color=\"\"#1ba954\"\">{0}%%</color> damage.\"",},
  [183]={ID=183,Key="des_skill_card_4_nirvana",Cn="击退附近的敌人，造成<color=\"\"#1ba954\"\">{0}%%</color>攻击力的伤害，同时为队友增加<color=\"\"#1ba954\"\">{0}%%</color>攻击力的护盾",En="\"Knock back nearby enemies dealing {0}%% damage. Additionally give teammates a shield that mitigates <color=\"\"#1ba954\"\">{0}%%</color> of his attack power.\"",},
  [184]={ID=184,Key="des_skill_card_5_nirvana",Cn="投掷毒瓶子，大范围群体持续伤害，每秒造成<color=\"\"#1ba954\"\">{0}%%</color>攻击力的伤害，持续4秒",En="\"Throw poison bottles damaging a large group of enemies dealing <color=\"\"#1ba954\"\">{0}%%</color> damage per second for 4s.\"",},
  [185]={ID=185,Key="des_skill_card_6_nirvana",Cn="对周围的敌人进行斩击，造成<color=\"\"#1ba954\"\">{0}%%</color>攻击力的伤害，并且使周围敌人昏迷1秒。",En="\"Slash surrounding enemies dealing <color=\"\"#1ba954\"\">{0}%%</color> damage and stunning them for 1s.\"",},
  [186]={ID=186,Key="des_skill_card_7_nirvana",Cn="使用盾牌猛击敌人，并将其击退，造成<color=\"\"#1ba954\"\">{0}%%</color>攻击力的伤害。",En="\"Slam the enemy with your shield knocking them back and dealing <color=\"\"#1ba954\"\">{0}%%</color> damage.\"",},
  [187]={ID=187,Key="des_skill_card_8_nirvana",Cn="发射三枚火箭弹，每枚造成<color=\"\"#1ba954\"\">{0}%%</color>攻击力的伤害。",En="\"Launch three rockets each dealing <color=\"\"#1ba954\"\">{0}%%</color> damage.\"",},
  [188]={ID=188,Key="des_skill_card_9_nirvana",Cn="电击周围的敌人，造成<color=\"\"#1ba954\"\">{0}%%</color>攻击力的伤害。",En="\"Electric shocks surround the enemies causing <color=\"\"#1ba954\"\">{0}%%</color> damage.\"",},
