  [232]={ID=232,Key="Tutorial_FirstEnterCity_storytell_1",Cn="毒气笼罩了整个世界，如同死神的阴影。在倒下之前，幸存者们终于找到了净化器。",En="The poisonous gas enveloped the world like a shadow of death. The survivors finally found the purifier.",},
  [233]={ID=233,Key="Tutorial_FirstEnterCity_dialogue_1",Cn="呃……我好像吸入了太多毒气，身体好疼……",En="Uh... I seem to have inhaled too much poisonous gas, and my body hurts...",},
  [234]={ID=234,Key="Tutorial_FirstEnterCity_dialogue_2",Cn="坚持一下！我马上把净化器打开！",En="Hold on",},
  [235]={ID=235,Key="Tutorial_FirstEnterCity_dialogue_3",Cn="（此句要删掉）",En="Let’s first put the purifier core into the base, and turn on the Purifier to dispel toxic gas",},
  [236]={ID=236,Key="Tutorial_BuildGenerator_notice_1",Cn="点击净化器",En="Tap the purifier",},
  [237]={ID=237,Key="Tutorial_BuildGenerator_notice_2",Cn="打开净化器",En="Turn on the purifier",},
  [238]={ID=238,Key="Tutorial_BuildLumberMill_dialogue_1",Cn="呼……终于呼吸到新鲜的空气了。",En="Phew...... finally breathing fresh air.",},
  [239]={ID=239,Key="Tutorial_BuildLumberMill_dialogue_2",Cn="你看，净化器燃料不多了，得赶紧想个办法。",En="Look, Purifier is running out of fuel. We need to do something.",},
  [240]={ID=240,Key="Tutorial_BuildLumberMill_dialogue_3",Cn="正好附近有很多树木可以当燃料，我们现在就建个木材厂吧！",En="There are many trees nearby that can be used as fuel. Let's build a Lumber Mill now",},
  [241]={ID=241,Key="Tutorial_BuildLumberMill_dialogue_4",Cn="（此句删掉）",En="Then better build a Lumber Mill quickly.",},
  [242]={ID=242,Key="Tutorial_BuildLumberMill_dialogue_5",Cn="（此句删掉）",En="It would be a good idea to build a Lumber Mill here.",},
  [243]={ID=243,Key="Tutorial_BuildLumberMill_notice_1",Cn="建造一个木材厂",En="Build a Lumber Mill",},
  [244]={ID=244,Key="Tutorial_BuildLumberMill_notice_3",Cn="再建造一个伐木斧",En="Make another Felling Ax",},
  [245]={ID=245,Key="Tutorial_BuildLumberMill_notice_4",Cn="再建造一个伐木斧",En="Make another Felling Ax",},
  [246]={ID=246,Key="Tutorial_BuildLumberMill_notice_5",Cn="再建造一个伐木斧",En="Make another Felling Ax",},
  [247]={ID=247,Key="Tutorial_BuildLumberMill_notice_6",Cn="分配幸存者砍木头",En="Assign survivors to chop wood",},
  [248]={ID=248,Key="Tutorial_BuildKitchen_dialogue_1",Cn="好饿好饿好饿，我的肚子要饿扁了……",En="I'm so hungry, so hungry. My stomach is so hungry...",},
  [249]={ID=249,Key="Tutorial_BuildKitchen_dialogue_2",Cn="再撑一会儿，我们马上搭一个厨房。",En="Hang on a little longer and we will build a Kitchen right away.",},
  [250]={ID=250,Key="Tutorial_BuildKitchen_notice_1",Cn="建造一个厨房",En="Build a Kitchen",},
  [251]={ID=251,Key="Tutorial_BuildKitchen_notice_2",Cn="建造一个锅",En="Build a kitchen table",},
  [252]={ID=252,Key="Tutorial_BuildKitchen_notice_4",Cn="分配幸存者做饭",En="Assign a survivor to cook a meal",},
  [253]={ID=253,Key="Tutorial_Eating_dialogue_1",Cn="别抢别抢，大家都有份。",En="Don't grab it. Don't grab it. Everybody gets a share.",},
  [254]={ID=254,Key="Tutorial_Eating_dialogue_2",Cn="终于有东西吃了！感觉我又重新活过来了！",En="Finally ate something",},
  [255]={ID=255,Key="Tutorial_Eating_dialogue_3",Cn="但是我们只有这一顿……没有剩下的食物了。",En="But it's the only meal we have... No leftovers.",},
  [256]={ID=256,Key="Tutorial_Eating_dialogue_4",Cn="唉……先填饱肚子再想办法。",En="Sigh... Fill your stomach first and think of a solution later.",},
  [257]={ID=257,Key="Tutorial_Eating_dialogue_5",Cn="（此句删掉）",En="Ay... However, under such conditions, it is also a good meal.",},
  [258]={ID=258,Key="Tutorial_Eating_storytell_1",Cn="好不容易，幸存者终于可以吃上一顿热饭了",En="The survivors can finally have a hot meal together.",},
  [259]={ID=259,Key="Tutorial_BuildCattleFarm_dialogue_1",Cn="我们得想一想以后吃什么了。",En="We have to think about what to eat in the future.",},
  [260]={ID=260,Key="Tutorial_BuildCattleFarm_dialogue_2",Cn="最好能吃肉补充体力，毕竟每天都要工作。",En="It's best to eat meat to replenish strength. After all, we have to work every day.",},
  [261]={ID=261,Key="Tutorial_BuildCattleFarm_dialogue_3",Cn="正好这里有几头牛，我们可以自己建个养殖厂！",En="There are a few cows here. We can build our own Cattle Farm",},
  [262]={ID=262,Key="Tutorial_BuildCattleFarm_notice_1",Cn="建造一个养殖厂",En="Build a Cattle Farm",},
  [263]={ID=263,Key="Tutorial_BuildCattleFarm_notice_2",Cn="分配幸存者工作",En="Assign survivors to work.",},
  [264]={ID=264,Key="Tutorial_BuildCattleFarm_storytell_1",Cn="幸存者已有生存的基础条件，帮助他们更长久地存活下去吧。",En="The survivors now have their basic needs met. Now let's help them thrive",},
  [265]={ID=265,Key="Tutorial_OverloadOpen_dialogue_1",Cn="咳咳，毒气怎么好像变得更浓了……",En="Ahem, the poisonous gas seems to be getting stronger...",},
  [266]={ID=266,Key="Tutorial_OverloadOpen_dialogue_2",Cn="是毒气口，晚上它喷发得更厉害了，怎么办？",En="It's a gas vent. It erupts more at night. What do we do?",},
  [267]={ID=267,Key="Tutorial_OverloadOpen_dialogue_3",Cn="快把净化器开大一点，先保命要紧。",En="Quickly turn up the purifier, save your life first.",},
  [268]={ID=268,Key="Tutorial_OverloadOpen_dialogue_4",Cn="（此句不要）",En="Hurry and turn Purifier to its extra power Keeping camp safe is the most important thing.",},
  [269]={ID=269,Key="Tutorial_OverloadOpen_dialogue_5",Cn="终于好多了，虽然没有彻底清除毒气，但也能睡觉了。",En="Finally, much better. Gas is not completely gone, but we can sleep now.",},
  [270]={ID=270,Key="Tutorial_OverloadOpen_dialogue_6",Cn="可是净化器一直过载的话，需要更多燃料。我们的木头够烧到早上吗？",En="But if Purifier always runs at extra power... Do we have enough wood until the morning?",},
  [271]={ID=271,Key="Tutorial_OverloadOpen_dialogue_7",Cn="先熬过今晚吧。以后要多存一些资源。",En="Let's get through tonight first. We can collect more resources in the future.",},
  [272]={ID=272,Key="Tutorial_OverloadOpen_dialogue_8",Cn="（此句不要）",En="Let's get through tonight first, and stock up on more wood later.",},
  [273]={ID=273,Key="Tutorial_OverloadClose_dialogue_1",Cn="白天毒气浓度下降了。我们成功挺过了夜晚！",En="The poison gas concentration dropped during the day. We made it through the night",},
  [274]={ID=274,Key="Tutorial_OverloadClose_dialogue_2",Cn="没错！先关掉过载吧，燃料可是很宝贵的，得省着点用。",En="That's right Let's turn off extra power. Fuel is precious. We have to save it.",},
  [275]={ID=275,Key="Tutorial_OverloadClose_dialogue_3",Cn="是啊，现在这种情况，要精打细算才行。",En="You're right. Wood is a precious resource out here.",},
  [276]={ID=276,Key="Tutorial_OverloadClose_notice_1",Cn="关闭净化器过载",En="Turn off the Purifier extra power",},
  [277]={ID=277,Key="Tutorial_OverloadClose_dialogue_4",Cn="没想到我们真的在末世里平安度过了一天。",En="Unexpectedly, we got safely through the latest days.",},
  [278]={ID=278,Key="Tutorial_OverloadClose_dialogue_5",Cn="只要我们继续积攒物资，总有一天我们能建立起一个安全的基地，长久地生存下去！",En="If we continue to accumulate supplies, one day we can build a safe base and be safe for a long time",},
  [279]={ID=279,Key="Tutorial_OverloadClose_dialogue_6",Cn="一想到这里，我浑身充满了干劲！",En="Thinking about it makes me feel so motivated",},
  [280]={ID=280,Key="Tutorial_OverloadClose_dialogue_7",Cn="哈哈，那我可要好好监督你工作。",En="Haha, then I have to supervise your work properly.",},
  [281]={ID=281,Key="Tutorial_OverloadClose_dialogue_8",Cn="咳咳！昨晚我差点被毒气憋死了！",En="Ahem",},
  [282]={ID=282,Key="Tutorial_OverloadClose_dialogue_9",Cn="我也是，咳，晚上的毒气真的太浓了……",En="Me too, cough, the gas is really strong at night...",},
  [283]={ID=283,Key="Tutorial_OverloadClose_dialogue_10",Cn="晚上还是开大一点吧！不然我担心睡过去就醒不过来了。",En="It's better to turn it up at night Otherwise, I'm worried that I won't be able to wake up.",},
  [284]={ID=284,Key="Tutorial_OverloadClose_dialogue_11",Cn="（此句删掉）",En="Let’s chop more wood during the day, to be able to turn on the extra power at night.",},
  [285]={ID=285,Key="Tutorial_OverloadClose_dialogue_12",Cn="唔好晕……怎么今天睡醒了这么难受？",En="So dizzy... Why is it so hard to wake up from sleep today?",},
  [286]={ID=286,Key="Tutorial_OverloadClose_dialogue_13",Cn="天啊！是半夜净化器燃料不够停掉了。",En="Oh no Purifier didn't have enough fuel, so it stopped working in the middle of the night.",},
  [287]={ID=287,Key="Tutorial_OverloadClose_dialogue_14",Cn="快去砍点木头，先把净化器开起来！",En="Go chop some wood and turn the Purifier on first",},
  [288]={ID=288,Key="Tutorial_OverloadClose_dialogue_15",Cn="（此句删掉）",En="Agreed， let's square away out basic needs first. No need to rush.",},
  [289]={ID=289,Key="Start building",Cn="开始建造",En="Start building",},
  [290]={ID=290,Key="Tutorial_Tap_Next",Cn="点击继续",En="Tap to continue",},
  [291]={ID=291,Key="Tutorial_EnterCity2_dialogue_1",Cn="这里曾经是一座矿场，但是很久以前就废弃了。",En="This used to be a mine, but it was abandoned a long time ago.",},
  [292]={ID=292,Key="Tutorial_EnterCity2_dialogue_2",Cn="哎……现在这个世界，哪里不是一片废土呢？",En="Hey... In this world now, where is it not a wasteland?",},
  [293]={ID=293,Key="Tutorial_EnterCity2_dialogue_3",Cn="不过，我们可以让这里重新活过来！",En="But we can bring this place back to life",},
  [294]={ID=294,Key="Tutorial_EnterCity2_dialogue_4",Cn="哈哈没错！煤矿可是非常好的能源啊！我们能建立一个更大的营地了。",En="Haha yes We'll be able to build a bigger camp.",},
  [295]={ID=295,Key="Tutorial_CardInfirmary_dialogue_1",Cn="快看，有个可怜虫生病了。",En="That poor guy fell sick.",},
  [296]={ID=296,Key="Tutorial_CardInfirmary_dialogue_2",Cn="别担心，我会尽全力救治他的。",En="I will do my best to save him.",},
