  [818]={ID=818,Key="mail_title_daily_gem",Cn="致亲爱的人类邻居",En="Dear Human Friend",},
  [819]={ID=819,Key="mail_content_daily_gem",Cn="\"您好！\n还记得那个掉进冰窟的倒霉蛋吗？托您的福，我的腿伤已经不碍事了。这里有一些我以前在觅食时找到的亮晶晶的东西，希望他们对您有用。如果您喜欢，在这次测试期间，我还会送更多来。再次感谢您高贵的善举。竖起尾巴向您致意一百次！\n又：我看到您的锯木厂中有许多松树。如果您不介意，我可以拿走一些松果吗？\n您毛茸茸的邻居\"",En="\"Hello Here are some shiny things I've found in the past. hope they will be useful to you. If you like it.Thanks again for your kindness. Wag my tail to you. SaluteI could send more during this test period.P.S. I saw a lot of pine trees in your sawmill. If you don't mind. may I take some pine cones?\nYours\nFluffy neighbor\"",},
  [820]={ID=820,Key="faction_attribute_bonus_stay_3",Cn="场上有三名相同职业的英雄时，获得属性加成，并增加 <color=\"\"#38F075\"\"><b>{0}%%</b></color> 个幸存者",En="\"When three heroes with the same profession on the field,they will get bonus attribute points,and add another <color=\"\"#EA9500\"\"><b>{0}%%</b></color> troops.\"",},
  [821]={ID=821,Key="faction_attribute_bonus_stay_3_2",Cn="场上有三名相同职业的英雄时，以及另外阵营两名相同阵营卡牌时，获得属性加成，并增加 <color=\"\"#38F075\"\"><b>{0}%%</b></color> 个幸存者",En="\"When three heroes with the same profession plus two heroes with another profession are on the field,they will get bonus attribute points,and add another <color=\"\"#EA9500\"\"><b>{0}%%</b></color> troops.\"",},
  [822]={ID=822,Key="faction_attribute_bonus_stay_4",Cn="场上有四名相同职业的英雄时，获得属性加成，并增加 <color=\"\"#38F075\"\"><b>{0}%%</b></color> 个幸存者",En="\"When four heroes with the same profession are on the field,they will get bonus attribute points,and add another <color=\"\"#EA9500\"\"><b>{0}%%</b></color> troops.\"",},
