  [1078]={ID=1078,Key="Tutorial_NightTalk_dialogue_1",Cn="真怀念末日之前的日子。要是以前，这会儿我应该是在家里，舒服地躺在床上。",En="I really miss the good old days. Back then, I would be at home right now, lying on the bed.",},
  [1079]={ID=1079,Key="Tutorial_NightTalk_dialogue_2",Cn="是啊……真怀念，没有毒气的星空。",En="Yes... I really miss the starry sky without poisonous gas.",},
  [1080]={ID=1080,Key="Tutorial_NightTalk_dialogue_3",Cn="你们说，我们能平安走下去吗？",En="Do you think, we can go on safely?",},
  [1081]={ID=1081,Key="Tutorial_NightTalk_dialogue_4",Cn="当然，今天我们就做得很好不是吗？吃了一顿饱饭，晚上还有地方睡觉。",En="Of course, we did a good job today, didn't we? Got a good meal and a place to sleep at night.",},
  [1082]={ID=1082,Key="Tutorial_NightTalk_dialogue_5",Cn="嗯，你说的对，我们一定能好好活下去的。",En="Well, you are right. We will definitely be able to live a good life.",},
  [1083]={ID=1083,Key="Tutorial_NightTalk_dialogue_6",Cn="没错。要相信这一点。",En="That's right. Need to believe in it.",},
  [1084]={ID=1084,Key="Tutorial_NightTalk_dialogue_7",Cn="而且，我们还要建立更大的生存基地，拥有更多的物资。",En="Moreover, we have to build a larger survival base and gather more supplies.",},
