  [1115]={ID=1115,Key="ui_event_reward_last_rank",Cn="您不在排行榜中",En="You are not on the leaderboard.",},
  [1116]={ID=1116,Key="city_summary_desc_1",Cn="在大家的共同努力下，平原森林成为了幸存者们在末日里的第一个营地。人们不但净化了周围的毒气，也拥有了源源不断的木材资源。这是人类在这个毒气蔓延的世界里，站稳脚跟的第一步。加油吧，肩负人类生存的希望，继续进发！",En="With everyone's joint efforts, the Plain Forest became the first camp for survivors in the apocalypse. People not only purified the poisonous gas around them, but also had endless wood resources. This is the first step for mankind to gain a foothold in this poisonous world. Come on, Commander, shoulder the hope of human survival and keep moving forward",},
  [1117]={ID=1117,Key="city_summary_desc_2",Cn="幸存者们运用这里丰富的煤矿，制作了新一代净化器滤芯，更高效节能。与此同时也在这里建成了可以持续供给煤的营地。但是要建设完整的产业链，还需要更丰富的资源。当然，幸存者的队伍也需要走向更遥远的地方，准备好了吗？",En="The survivors used the rich coal mines here to produce a new generation of purifier filter elements, which are more efficient and energy-saving. At the same time, a camp that can continuously supply coal was built here. But to build a complete industrial chain, more abundant resources are needed. Of course, the team of survivors also needs to go to more distant places. As the commander, are you ready?",},
  [1118]={ID=1118,Key="city_summary_desc_3",Cn="营地被建立、废墟被清扫、建筑被修复……小镇似乎有了末日之前的繁荣景象。在大家的努力生产下，净化器也有了持续可用的发动机。或许，这是新一次工业革命的号角？",En="Camp was established, ruins were cleared, buildings were repaired... The town seemed to have the prosperity it had before the end. Thanks to everyone's hard work, the purifier also has a continuously usable engine. Perhaps this is the clarion call for a new industrial revolution?",},
  [1119]={ID=1119,Key="city_summary_desc_4",Cn="沉默在土里的矿石重新得到利用，然后变成了建筑和生产材料。上天没有给人们关上所有的窗，有了这些材料制作的电灯，即使在黑夜和毒气里也不会迷失了。",En="Ore that was in the soil was reused and turned into construction and production materials. With electric lights made of these materials, we will not be lost even in the dark of the night or in the poisonous gas.",},
  [1120]={ID=1120,Key="city_summary_desc_5",Cn="衣食住行是人们生存的必要条件，有了前几个营地的材料支持，人们终于能够开始自己制作衣服了。有了防护服做保护，就拥有了更大的活动空间。也许有一天，人们可以不再需要穿防护服就能自由行走在旷野中，抬头看见蓝天，也许。",En="Food, clothing, housing and transportation are necessary for humans survival. With the support of materials from the previous camps, people were finally able to start making their own clothes. With the protective clothing, we have more space for movement. Maybe one day, people could walk freely in the wilderness without wearing protective clothing and look up at the blue sky.",},
  [1121]={ID=1121,Key="city_summary_desc_6",Cn="这座荒芜的城市在末日后重新拥有了生机。有了蒸汽炉之后，幸存者们在往后的路途上可以制作出更多的工业产品。人类城市也许会荒芜，但人类文明永远不会止步。",En="\"When thinking of a \"\"city\"\", a variety of industrial activities spring to mind. So the expedition rebuilt the steam furnace,and upgraded it. Later, they could finally undertake basic industrial production.\"",},
  [1122]={ID=1122,Key="city_summary_desc_7",Cn="在末日之初，世界一片废土时，如果有人说可以自己制作发电机和机械，肯定会让人开口大笑吸进一口毒气。但是现在，这成为了现实。机械遗址如今不再是遗址，它重新有了文明的色彩。",En="\"God only knows how much effort the expedition made to connect this isolated island with the mainland. To transport supplies. they even came up with motors and machinery. Now, human civilization has finally returned to this once abandoned place.\"",},
  [1123]={ID=1123,Key="ui_hint_get",Cn="获得",En="Claim",},
  [1124]={ID=1124,Key="ui_hint_lose",Cn="消耗",En="Cost",},
