  [1132]={ID=1132,Key="Tutorial_ToCity2_dialogue_1",Cn="没想到我们在这里生活了这么久，还救了这么多人！",En="I didn't realize we have lived here for so long and sheltered so many people",},
  [1133]={ID=1133,Key="Tutorial_ToCity2_dialogue_2",Cn="是啊，不过只有木头还不够，我们需要更高效的燃料。",En="Yeah, but just wood isn't enough. We need more efficient fuel.",},
  [1134]={ID=1134,Key="Tutorial_ToCity2_dialogue_3",Cn="我知道附近有个煤矿厂，或许还能用煤做些新的东西。我们这就出发吧！",En="I know a coal plant nearby. Maybe we can do something with coal. Let's get going",},
  [1135]={ID=1135,Key="Tutorial_ToCity2_dialogue_4",Cn="好！而且我们还能带上这里的木板做补给。",En="Ok And we can also bring wooden planks here for supplies.",},
  [1136]={ID=1136,Key="Tutorial_ToCity2_dialogue_5",Cn="（此句删掉）",En="Okay, then let’s set off",},
  [1137]={ID=1137,Key="Tutorial_ToCity2_dialogue_6",Cn="好，那我们这就出发！",En="Alright, let's go then",},
  [1138]={ID=1138,Key="Tutorial_ToCity2_dialogue_7",Cn="不能再耽搁了，带上些木板，咱们这就出发",En="No more delays， bring some boards and let's go",},
