  [1151]={ID=1151,Key="rogue_enter_deny_tips",Cn="探索已经结束，一段时间后将刷新",En="\"Adventure ended， will refresh soon\"",},
  [1152]={ID=1152,Key="rmodifiedogue_intro",Cn="\"选择卡牌来进行探索：\n1.在能量耗尽以前尽可能前进，来获取更多的资源；\n2.选择人员来补充你的队伍，让他们能击败遇到的敌人；\n3.每经过一个事件，你会获得宝箱进度，开启宝箱可以任选一张卡牌.\"",En="\"Select the heros to start an Adventure:\n 1. Advance as far as possible before running out of energy to claim more resources.\n 2. Choose a unit to replenish your team so they can defeat any enemies they encounter.\n 3. After each event\n you will obtain chest progress， open a chest to choose any card.\"",},
