  [1161]={ID=1161,Key="unit_1_des",Cn="在战斗前增加全员15%攻击",En="Raises the whole team's attack by 15% before battle",},
  [1162]={ID=1162,Key="unit_2_des",Cn="减少10%每回合的能量损失",En="Reduces energy loss by 10% each turn",},
  [1163]={ID=1163,Key="unit_3_des",Cn="回合结束治疗受伤最重的队友50%最大生命值",En="Heals the most injured teammate by 50% of max HP at the end of the turn",},
  [1164]={ID=1164,Key="unit_4_des",Cn="回合结束治疗所有队友20%最大生命值",En="Heals all teammates by 20% of max HP at the end of the turn",},
  [1165]={ID=1165,Key="unit_5_des",Cn="增加所有幸存者类型的攻击20%",En="Raises the attack of all survivor types by 20%",},
  [1166]={ID=1166,Key="unit_7_des_modified",Cn="恢复10点能量，并恢复所有角色20%生命值",En="Restores 10 points of energy and 20% of HP for all characters",},
  [1167]={ID=1167,Key="unit_8_des",Cn="战斗前点起篝火，为队友增加30%攻击速度",En="\"Light a fire before battle， raising teammates' attack speed by 30%\"",},
  [1168]={ID=1168,Key="rogue_intro_title",Cn="详情展示",En="More",},
  [1169]={ID=1169,Key="Tutorial_SurvivorSick_dialogue_1",Cn="你脸色看起来不太好啊……糟糕！这是初步感染的症状。",En="You don't look too good... Oh It's a symptom of the initial infection.",},
  [1170]={ID=1170,Key="Tutorial_SurvivorSick_dialogue_2",Cn="赶紧停止工作，躺下休息吧。",En="Just stop working and lie down to rest.",},
  [1171]={ID=1171,Key="Tutorial_SurvivorSick_dialogue_3",Cn="唔……好疼……要是有个医疗站，能够得到及时的治疗就好了……",En="Well... It hurts... If only there was a Medical Station where we could get prompt treatment...",},
  [1172]={ID=1172,Key="Tutorial_SurvivorSick_dialogue_4",Cn="没错，我们需要一个急救站，不能眼睁睁看着人们因感染而死去！",En="Yes, we need a first aid station. We can't just watch people die from infection",},
  [1173]={ID=1173,Key="Tutorial_SurvivorSick_dialogue_5",Cn="（此句删掉）",En="I'd rather want them to be healthy than working.",},
  [1174]={ID=1174,Key="Tutorial_SurvivorSick_dialogue_sleep_1",Cn="哦上帝，你怎么了。",En="Oh god， what happened.",},
  [1175]={ID=1175,Key="Tutorial_SurvivorSick_dialogue_sleep_2",Cn="你看着难受极了。",En="You don't look so well.",},
  [1176]={ID=1176,Key="Tutorial_SurvivorSick_dialogue_sleep_3",Cn="你不能继续工作了，快回去休息吧...",En="You can't continue working like this, go get some rest...",},
  [1177]={ID=1177,Key="Tutorial_SurvivorSick_dialogue_sleep_4",Cn="劳逸结合很重要的，我的朋友。",En="It's important to balance work and rest， my friend.",},
  [1178]={ID=1178,Key="Tutorial_SurvivorSick_notice_1",Cn="点击查看生病原因等说明",En="Tap to view reasons for sickness and other explanations",},
  [1179]={ID=1179,Key="Tutorial_TutorialOpenBox_dialogue_1",Cn="煤真的快不够用了，净化器一直在烧，我们还需要煤来建造医院啊！",En="Coal is running out. Purifier is burning all the time, but we still need coal to build the hospital",},
  [1180]={ID=1180,Key="Tutorial_TutorialOpenBox_dialogue_2",Cn="我们得提高煤矿的产量！",En="We have to boost Coal Mine output",},
  [1181]={ID=1181,Key="Tutorial_TutorialOpenBox_dialogue_3",Cn="可是有些挖煤的工具我根本不会用啊",En="I've no idea how to use some of these tools...",},
  [1182]={ID=1182,Key="Tutorial_TutorialOpenBox_dialogue_4",Cn="也许我们可以找人来帮忙",En="Maybe we can get some help.",},
  [1183]={ID=1183,Key="Tutorial_CardCoalMine_dialogue_1",Cn="我是玛尔达，很荣幸加入你们！",En="I'm James， and it is an honor to join you",},
  [1184]={ID=1184,Key="Tutorial_CardCoalMine_dialogue_2",Cn="末日之前我家经营着煤矿厂，现在有我在，一定可以帮大家<color=\"\"#0b993c\"\">提升煤矿产量</color>。",En="I am a third-generation miner, <color=\"\"#0b993c\"\"> my experience will boost our mining capacity</color> I'll certainly do what I can to help.",},
