  [1211]={ID=1211,Key="ui_event_slot_good_luck",Cn="祝你好运",En="GOOD LUCK",},
  [1212]={ID=1212,Key="ui_event_rank_unlock",Cn="完成第{0}里程碑解锁排行榜",En="Leaderboard unlocked after Milestone {0}",},
  [1213]={ID=1213,Key="rogue_three_to_one_card_des",Cn="\"等级{0}",En="Lv.{0}. Select a hero to help you complete the Adventure",},
  [1214]={ID=1214,Key="ui_slot_reward_card_title",Cn="拉霸机奖励",En="Slot Reward",},
  [1215]={ID=1215,Key="ui_slot_reward_card_txt",Cn="恭喜你！你获得一张英雄卡牌，你可以在主场景使用它。",En="Congratulations You've obtained a hero to use in in the main city.",},
  [1216]={ID=1216,Key="Tutorial_Res_Click_tips",Cn="资源不足，点击ICON查看资源详情",En="Not enough resources. Tap the icon for resource details",},
  [1217]={ID=1217,Key="ui_event_rank_userinfo_end",Cn="活动已经结束，无法修改用户信息",En="The event has ended. User info cannot be modified",},
  [1218]={ID=1218,Key="ui_event_data_cost_selling",Cn="消耗&卖出",En="Cost&Sales",},
  [1219]={ID=1219,Key="ui_event_trick_level_max",Cn="满级",En="Max",},
  [1220]={ID=1220,Key="city",Cn="一处位于平原的森林，在逃离城市之后，这里似乎是一个比较安全的临时落脚点。森林里取之不尽的树木可以为幸存者提供基本的生存条件。",En="A forest on the plains seems to be a relatively safe temporary place to stay after escaping from the city. The endless supply of trees in the forest can provide everything necessary for survival.",},
  [1221]={ID=1221,Key="city_desc_2",Cn="荒野中被废弃的矿场，残存着一些人类工业的痕迹。不论是在末世还是在和平时代，这里的煤矿都是非常重要的能源。",En="Abandoned mines in the wilderness retain some traces of human industry. Whether at the end of the world or in peacetime, coal mines are very important energy sources.",},
  [1222]={ID=1222,Key="city_desc_3",Cn="小镇上的铁矿曾经非常出名。只是在末世来临之后，生产荒废，再也没有人在这里活动。小镇静静地待在山谷中，似乎在等着人将它唤醒，重新利用起这些优质的铁矿资源。",En="This town was once very famous for its iron mines. But after the end of the world, production was abandoned and no one was active here anymore. Iron Town stayed quietly in the valley, seemingly waiting for someone to wake it up and reuse its high-quality iron ore resources.",},
  [1223]={ID=1223,Key="city_desc_4",Cn="末日降临前，这里曾经是世界知名的巨大矿脉之一，许多人类工业都依靠着这些石头建立。如今没有人还记得起这些矿山的名字，只剩下一片废墟，默默悼念着昔日的繁荣。",En="Before the end of the world, this place was once one of the world's most important mineral artery, and many human industries relied on these stones. Today no one still remembers the names of these mines. Only ruins remain, silently mourning the prosperity of the past.",},
  [1224]={ID=1224,Key="city_desc_5",Cn="这个废弃的据点有着许多人类活动的痕迹，也许末日之初，这里是一个大型的安全区，但如今这里已经没有人类，只剩下蔓延的毒气和破损的建筑。",En="This abandoned stronghold has many traces of human activities. Perhaps it was a large safe zone at the end of the world, but now there are no humans here, only the spreading poisonous gas and damaged buildings.",},
  [1225]={ID=1225,Key="city_desc_6",Cn="看着眼前开阔的地形、高楼建筑和地上四通八达的公路，任谁都会说这是一个繁华的大都市——“曾经”是一个大都市。不过如今，它也和所有被毒气吞没的地方一样，荒芜、安静、死气沉沉了。",En="\"Looking at the tall buildings， highways and overpasses lined up in front of us， anyone would say that this is a bustling metropolis - \"\"once\"\" a metropolis is more accurate. Today， it is just as cold， quiet and desolate as all the places buried in snow and ice.\"",},
  [1226]={ID=1226,Key="city_desc_7",Cn="一座人类世界中著名的机械之城，曾是人类科技的中心。毒气爆发后，这里也是最快沦陷的地方。钢铁森林在末日下变得更加冰冷，谁还会记得这里曾经的繁华呢？",En="\"An isolated island in the middle of the ocean, so quiet that even the seabirds don't seem to want to pass by and only a few unlucky ships are stranded nearby. On this island, you have to shout with all your might to be heard.\"",},
  [1227]={ID=1227,Key="Tutorial_ToBattle_dialogue_1",Cn="啊，你刚刚干什么了？",En="Ah， what did you just do?",},
  [1228]={ID=1228,Key="Tutorial_ToBattle_dialogue_4",Cn="不久前，我发现我正是这少数人之一，于是尝试使用<color=\"\"#0b993c\"\">经验卡来提升我的能力</color>。",En="Not long ago, I discovered I was one of a special few and tried to use <color=\"\"#0b993c\"\">Exp Card to enhance my abilities</color>.",},
  [1229]={ID=1229,Key="Tutorial_ToBattle_dialogue_5",Cn="我们现在处在发展的紧要关头，如果能得找到更多经验卡一定大有裨益！",En="We're at a critical juncture in our development and we need to find more Exp Cards",},
  [1230]={ID=1230,Key="Tutorial_ToBattle_dialogue_6",Cn="所以我想带一些人马先去周围打探打探。",En="So I want to take some people to have a look around first.",},
  [1231]={ID=1231,Key="Tutorial_ToBattle_dialogue_7",Cn="啊啊啊，好大的一头熊啊，我还没见过这么大的熊呢！",En="That was a massive bear",},
  [1232]={ID=1232,Key="Tutorial_ToBattle_dialogue_8",Cn="好危险啊，有点后怕，不过我们真的得到了经验卡。",En="It was risky， but we found a Exp Card.",},
  [1233]={ID=1233,Key="Tutorial_ToBattle_dialogue_9",Cn="这种冒险是值得的！",En="No regrets",},
  [1234]={ID=1234,Key="Tutorial_ToBattle_dialogue_10",Cn="而且有James在，他的大锤真厉害！下次我还要去！",En="Thanks to James and his awesome sledgehammer",},
  [1235]={ID=1235,Key="unit_9_name",Cn="头狼",En="Alpha Wolf",},
  [1236]={ID=1236,Key="unit_10_name",Cn="狼",En="Wolf",},
  [1237]={ID=1237,Key="unit_11_name",Cn="野猪王",En="Alpha Boar",},
  [1238]={ID=1238,Key="unit_12_name",Cn="野猪",En="Boar",},
