  [1247]={ID=1247,Key="Tutorial_EventIntro_dialogue_1",Cn="又下雪了，一眼望去只有白晃晃的一片",En="It's really coming down now. A blanket of white as far as the eye can see.",},
  [1248]={ID=1248,Key="Tutorial_EventIntro_dialogue_2",Cn="真要命，吃口饭已经很不容易了，还得想想怎么对抗这枯燥的全白色",En="Finding food is hard enough - not to mention all this snow",},
  [1249]={ID=1249,Key="Tutorial_EventIntro_dialogue_3",Cn="你们没能见过冰期以前的景象，真是遗憾啊",En="It's a shame you didn't see what it was like before the Ice Age.",},
  [1250]={ID=1250,Key="Tutorial_EventIntro_dialogue_4",Cn="奥拓，给我们讲讲以前的生活吧",En="Otto， tell us about the good old days...",},
  [1251]={ID=1251,Key="Tutorial_EventEnterCity_dialogue_1",Cn="那个时候一年还分四季，春夏秋冬各有不同的景色",En="Back then, there were still four seasons, with spring, summer, fall, and winter, all different.",},
  [1252]={ID=1252,Key="Tutorial_EventEnterCity_dialogue_2",Cn="春天到处都是绿油油的",En="Everything looked fresh and green in spring",},
  [1253]={ID=1253,Key="Tutorial_EventEnterCity_dialogue_3",Cn="我小时候的春天都在爷爷的农场度过",En="During my childhood， I spent the spring on my grandfather's farm.",},
  [1254]={ID=1254,Key="Tutorial_EventEnterCity_dialogue_4",Cn="农忙时节，爷爷会雇佣很多工人和专家来农场帮忙",En="In the busy season， grandpa would hire many workers to help him with the harvest.",},
  [1255]={ID=1255,Key="Tutorial_EventEnoughFood_dialogue_1",Cn="爷爷总是给大家提供最好的食宿",En="He always provided the best food and living quarters for his people.",},
  [1256]={ID=1256,Key="Tutorial_EventEnoughFood_dialogue_2",Cn="他说，我们农场啥都有，要给大家吃好的",En="He said, \"The farm gives us everything, so we should give back to others when we can.\"",},
  [1257]={ID=1257,Key="Tutorial_EventWarehouse_dialogue_1",Cn="那个时候，人们不用担心自己被冻死，但也得关心一个东西——钱。",En="Those days, people didn't have to worry about freezing to death, they only worry about cash.",},
  [1258]={ID=1258,Key="Tutorial_EventWarehouse_dialogue_2",Cn="人们需要付出劳动赚钱，也花钱购买自己需要的东西。",En="People provided their labor to earn money and then spent it on things they needed.",},
  [1259]={ID=1259,Key="Tutorial_EventWarehouse_dialogue_3",Cn="我爷爷就把种出来的粮食都卖钱，然后购买生产机器来扩大生产",En="My grandfather sold all the food he grew, and then bought machinery to expand his farm.",},
  [1260]={ID=1260,Key="Tutorial_EventSlot_dialogue_1",Cn="爷爷还给大家准备了娱乐设施，结束了一天的工作可以放松放松",En="Grandpa also set up recreational facilities so everyone could relax after a long day's work.",},
  [1261]={ID=1261,Key="Tutorial_EventSlot_dialogue_2",Cn="没准还能有意外收获",En="We might just be in luck",},
  [1262]={ID=1262,Key="Tutorial_EventTrick_dialogue_1",Cn="嘿，农场需要的可不止是生产相关的技能",En="Hey, farms need more than just those with production-related skills",},
  [1263]={ID=1263,Key="Tutorial_EventTrick_dialogue_2",Cn="拥有良好的销售技能也是很重要的",En="Skills related to production are great but farms also require other skills and expertise.",},
  [1264]={ID=1264,Key="ui_event_enter_coming",Cn="即将开始",En="Coming soon",},
  [1265]={ID=1265,Key="ui_assign_card_get_hero",Cn="获取英雄",En="Claim Hero",},
  [1266]={ID=1266,Key="Tutorial_NightTalk_dialogue_2",Cn="是啊……真怀念，没有毒气的星空。",En="Yes... I really miss the starry sky without poisonous gas.",},
  [1267]={ID=1267,Key="Tutorial_NightTalk_dialogue_3",Cn="你们说，我们能平安走下去吗？",En="Do you think, we can go on safely?",},
  [1268]={ID=1268,Key="Tutorial_NightTalk_dialogue_4",Cn="当然，今天我们就做得很好不是吗？吃了一顿饱饭，晚上还有地方睡觉。",En="Of course, we did a good job today, didn't we? Got a good meal and a place to sleep at night.",},
  [1269]={ID=1269,Key="Tutorial_NightTalk_dialogue_5",Cn="嗯，你说的对，我们一定能好好活下去的。",En="Well, you are right. We will definitely be able to live a good life.",},
  [1270]={ID=1270,Key="Tutorial_NightTalk_dialogue_6",Cn="没错。要相信这一点。",En="That's right. Need to believe in it.",},
