  [1448]={ID=1448,Key="city_name_8",Cn="基地旧址",En="Air Base",},
  [1449]={ID=1449,Key="city_name_9",Cn="遗弃酒厂",En="Snowcap Castle",},
  [1450]={ID=1450,Key="city_name_10",Cn="盆地油田",En="Oil Well",},
  [1451]={ID=1451,Key="city_name_11",Cn="火山脚下",En="Volcano Foothills",},
  [1452]={ID=1452,Key="city_name_12",Cn="钢铁厂",En="Steel Mill",},
  [1453]={ID=1453,Key="city_name_13",Cn="体育场",En="Stadium",},
  [1454]={ID=1454,Key="city_name_14",Cn="风车村",En="Windmill Village",},
  [1455]={ID=1455,Key="city_name_15",Cn="军事基地",En="Military Base",},
  [1456]={ID=1456,Key="city_name_16",Cn="游乐场",En="Amusement Park",},
  [1457]={ID=1457,Key="city_name_17",Cn="岛上监狱",En="Island Prison",},
  [1458]={ID=1458,Key="city_name_18",Cn="港口",En="Port",},
  [1459]={ID=1459,Key="city_name_19",Cn="火车站",En="Railway Station",},
  [1460]={ID=1460,Key="city_name_20",Cn="废弃的机场",En="Abandoned Airport",},
  [1461]={ID=1461,Key="city_desc_8",Cn="这个基地曾经是末日之前的一个安全所，而如今，只剩下满目的残骸，没人知道这里到底经历了什么。不过这些剩下的材料却能让幸存者们生产出更有用的物品。",En="This space base once blasted humans into space. But now， all that remains are scraps of old aviation materials piled high into a mountain of trash. It's time to put all these materials to good use.",},
  [1462]={ID=1462,Key="city_desc_9",Cn="这座酒厂曾产出过著名的美酒，但如今酒厂的废墟里已经闻不见美酒的香气，只剩下蔓延的毒气，这只不过是毁灭在末日中的人类文明成果之一罢了。",En="Warming fires, glistening chandeliers, endless banquets... Reminds you of a fancy castle scene, right? Unfortunately, this gorgeous piece of architecture is now submerged in snow.",},
  [1463]={ID=1463,Key="city_desc_10",Cn="盆地上的油井曾经是人类的重要资源点。虽然因为末日而被废弃，但是开采石油的设备还可以使用，这对幸存者来说是一件好事。",En="\"On a frozen sea， a gargantuan drilling platform can look like a man-made island. The equipment used for extracting oil has not been completely abandoned. These resources could come in handy if our expedition can",},
  [1464]={ID=1464,Key="city_",Cn="在这里，空气中弥漫着硫磺刺鼻的臭气，附近的水域被严重污染。显然，这不是什么宜居之地，不过人们仍能在此获得火山的馈赠——硫矿石。",En="\"Here, the air is filled with the pungent stench of sulfur while the nearby waters are heavily polluted. It's obviously not a pleasant place to live, but people still clamber for the volcano's natural gift - sulfur ore.\"",},
  [1465]={ID=1465,Key="city_desc_12",Cn="如果说神庙和石柱记录着古埃及人的信仰，谁又能说这样一座钢铁厂不是旧工业时代的神迹呢？",En="\"If the ancient Egyptians used temples and stone pillars to record their faith and beliefs, who's to say that a steel mill can't be considered a relic of the old industrial era?\"",},
  [1466]={ID=1466,Key="city_desc_13",Cn="看看这些气派的酒店和雪道！旧时代，这里曾经是一处冬季滑雪的旅游胜地，而如今，人们可不需要特地乘飞机来滑雪了。",En="\"Check out these imposing hotels and snowy trails In the old days, this was a winter ski resort， but nowadays, people don't need to travel far to find a place to ski.\"",},
  [1467]={ID=1467,Key="city_desc_14",Cn="作为世上最知名的风车小镇之一，这个地方完整地保持着十八世纪的风貌——造船厂、博物馆、市政厅……当然啦，还有数以百计的巨大风车。",En="\"One of the most famous windmill towns in the world， this place is still intact from the 18th century - there's shipyards, museums, a townhall... and, of course, hundreds of huge windmills\"",},
  [1468]={ID=1468,Key="city_desc_15",Cn="这座隐藏在山谷中的军事基地曾经可以瞬间夺去数百万人的生命。不过现在，这里只剩下些破破烂烂的装甲车和武器被随意地丢在一旁。",En="\"This hidden-away military base once hosted enough might to easily conquer territory as far as the eye can see. But now, all that's left are some broken armored cars and some old weapons tossed around.\"",},
  [1469]={ID=1469,Key="city_desc_16",Cn="行走在废弃的过山车和摩天轮之间，我们似乎还能听到人们的欢声笑语、闻到棉花糖和冰激凌香甜的气味。游乐场可以带来欢乐，当然，也可以带来资源。",En="\"Walking between the abandoned rollercoaster and ferris wheel, it's as if you can still hear the people's laughter and smell that sweet aroma of cotton candy. Amusement parks can bring joy and, of course, resources.\"",},
  [1470]={ID=1470,Key="city_desc_17",Cn="这里曾经被用来关押世界上最穷凶极恶的罪犯，整座监狱岛被重重把守，只有一座大桥与外界相连。或许，我们是第一批自愿踏上这座岛屿的人？",En="\"Once used to hold the world's most vicious criminals, the entire prison island was heavily guarded. Only one bridge connected it to the outside world. Perhaps we are the first to set foot on the island by choice?\"",},
  [1471]={ID=1471,Key="city_desc_18",Cn="在这个港口周围环绕着无数座工厂，每天成百上千吨货物被直接装上轮船，发往世界各地。现在，让我们来看看能不能利用这些工厂再造出点什么。",En="Surrounding this port are countless factories where hundreds of tons of goods were once loaded onto ships daily. Let's see if we can use these factories to create something new.",},
  [1472]={ID=1472,Key="city_desc_19",Cn="这里曾经是一座火车站，不过在冰期到来前便已经废弃，成了一座文艺青年们最喜爱的时尚工业园区。现在，人们还能看到园区里许多由废弃的车厢和铁轨改造而来的艺术品呢。",En="This was once a railway station. It was actually abandoned before the ice hit and became a fashionable industrial park popular with hipsters. You can still see the pieces of art made out of the original abandoned carriages and railway tracks.",},
  [1473]={ID=1473,Key="city_desc_20",Cn="如果现在世界上还有能起飞的飞机的话，或许探险队的旅程就不必这么辛苦了。不过好在这座飞机场保存十分完好，或许我们可以在机械工厂中看看我们能做出什么。",En="\"If only we still had planes capable of making it into the skies They would make our expeditions far simpler. Well at least this airfield is very well preserved, perhaps we can make something in the machinery factory to use here.\"",},
  [1474]={ID=1474,Key="city_summary_desc_8",Cn="在废土的环境下建立起实验室是人类对抗末日的一大步。现在，幸存者们可以生产青霉素了，医疗水平得到了质的提升！",En="Thanks to everyone's hard work, we've finally built a Laboratory. Now, we can produce antibiotics, this will greatly improve our level of medical treatment. Hooray",},
  [1475]={ID=1475,Key="city_summary_desc_9",Cn="有了工业温室产出的葡萄，幸存者们可以酿造美酒了。能在末日中享受美酒，怎么不算一种特殊的幸福呢？干杯，敬生存！",En="While we can no longer have grand fancy banquets, those grapes grown in the Industrial Greenhouse mean we can at least make some fine wine. Cheers to all our hard work",},
  [1476]={ID=1476,Key="city_summary_desc_10",Cn="有了这些油井，现在，幸存者们可以开采石油了。在能源紧缺的日子里，谁说这些黑乎乎的粘稠液体比不上黄金呢？",En="With those oil wells, survivors can actually extract oil",},
  [1477]={ID=1477,Key="city_summary_desc_11",Cn="看着这些被开采的硫磺矿，工人们欣慰地叹了一口气。太好了，他们再也不用忍受那种臭鸡蛋的气味儿了！",En="The workers sighed with relief at the completion of the sulfur mining. They no longer have to put up with the smell of rotten eggs",},
  [1478]={ID=1478,Key="city_summary_desc_12",Cn="探险队如今已经不缺钢铁了。不过感谢钢铁厂外那道长长的河滩，探险队有了额外的收获。",En="\"The expedition has no shortage of steel today. But thanks to the long river bank outside the mill, the expedition enjoys a bumper supply\"",},
  [1479]={ID=1479,Key="city_summary_desc_13",Cn="成功地在温室种植出亚麻以后，我们很快便制作出了绳索，然后，你猜怎么着？我们现在可以在雪地上用雪帆船航行啦！",En="\"After successfully growing flax in the greenhouse, we were able to make rope, and then, guess what? We started sailing through the snow on snow sailboats\"",},
  [1480]={ID=1480,Key="city_summary_desc_14",Cn="咩、咩……是谁在学羊叫？原来是我们拥有了绵羊养殖场！有人想来一件暖和的羊毛大衣吗？",En="\"Baa, Baa ...... Who's that doing all the baaing? We have an actual sheep farm Who wants a warm wool coat?\"",},
  [1481]={ID=1481,Key="city_summary_desc_15",Cn="借着基地里保存完好的制造设备，我们造出了雪地车。冰期降临以来，人们可真是太久没拥有过车辆这种先进的交通工具了。现在，我们可以探索更广阔的的地区。",En="\"With the well-preserved manufacturing gear at the base, we built a snowmobile. We've been way too long without advanced transportation. Now we can explore a wider area.\"",},
  [1482]={ID=1482,Key="city_summary_desc_16",Cn="当旋转木马五颜六色的灯光重新在废弃许久的游乐园中亮起时，除了闹鬼，也可能是有一队勤劳的探险队在这里修建了发电厂哟！",En="The lights of the carousel turning on again after such a long time in the abandoned amusement park? Could it be ghosts? Or could it be those hardworking survivors that set up a power plant here",},
  [1483]={ID=1483,Key="city_summary_desc_17",Cn="听说犯人们要在这里大量劳作，很不幸的是，我们也一样。他们制作的或许是衣服和雨伞，而我们则在加工厂造出了铅电池。",En="\"I heard the inmates here had to carry out a lot of labor, as did we. While they made clothes and umbrellas perhaps, we built lead batteries in our workshop.\"",},
  [1484]={ID=1484,Key="city_summary_desc_18",Cn="当塞满鱼肉的罐头再次在工厂的流水线上出现时，所有人都激动地欢呼起来。这下，我们终于能够处理和携带那些海洋中一锅炖不下的大块头啦。",En="Everyone cheered when cans stuffed with fish appeared on the assembly line. Now we can finally properly handle all those big catches from the ocean too big for one pot.",},
  [1485]={ID=1485,Key="city_summary_desc_19",Cn="哔、哔……这里是探索电台……有人收到吗？哦，没什么特别的，就是告诉你一声儿：我们有收音机啦！",En="\"Beep, boop... This is Exploration Radio... Anyone receiving? Oh, ok then. Just so you know: we have a radio\"",},
  [1486]={ID=1486,Key="city_summary_desc_20",Cn="人类第一次飞上蓝天时，心情想必不会比我们现在更雀跃。有了滑翔机，我们终于可以真正意义上地“出趟远门”啦！",En="\"When the Wright Brothers first managed the feat of flight, they could not have been more exciting than us here right now\"",},
