  [1630]={ID=1630,Key="Story_city2_dialog3_2",Cn="当然，史黛拉。",En="Of course, Stella.",},
  [1631]={ID=1631,Key="Story_city2_dialog3_3",Cn="那天玛尔达他们遭到袭击后，我一直忧心忡忡……",En="I've been worried since James and the others came under attack that day...",},
  [1632]={ID=1632,Key="Story_city2_dialog3_4",Cn="而且，最近经常有工人在拆除铁皮时受伤。",En="Also, workers have been getting injured a lot recently when extracting iron.",},
  [1633]={ID=1633,Key="Story_city2_dialog3_5",Cn="我觉得我们应该<color=\"\"#0b993c\"\">升级医疗站</color>。",En="I think we should <color=\"\"#0b993c\"\">upgrade our Medical Station</color>.",},
  [1634]={ID=1634,Key="Story_city2_dialog3_6",Cn="你说得有道理，史黛拉。",En="You have a point，Stella.",},
  [1635]={ID=1635,Key="Story_city2_dialog3_7",Cn="为此，我们需要<color=\"\"#0b993c\"\">模具、铁皮和煤矿</color>。",En="We'll need <color=\"\"#0b993c\"\">Mold,Iron, and Coal</color>.",},
  [1636]={ID=1636,Key="Story_city2_dialog3_8",Cn="谢谢你，奥托。这样一来，我就能更好的治疗伤员和病号了。",En="Thank you, Otto. I'll be able to better help the wounded and sick.",},
  [1637]={ID=1637,Key="Story_city3_dialog2_1",Cn="奥托，感谢你为我加固了我的床板。",En="Otto, thanks for reinforcing my bed.",},
  [1638]={ID=1638,Key="Story_city3_dialog2_2",Cn="区区小事，不足挂齿。",En="It's nothing, really.",},
  [1639]={ID=1639,Key="Story_city3_dialog2_3",Cn="不过咱们房间怪冷清的，再摆一个床如何？",En="But our room is strangely deserted, how about building another bed?",},
  [1640]={ID=1640,Key="Story_city3_dialog2_4",Cn="当然可以，这样我们就能接收更多幸存者了。",En="Of course, then we can take in more survivors.",},
  [1641]={ID=1641,Key="Story_city3_dialog3_1",Cn="完成了！真受不了你们男人总是把东西随手乱放。",En="There you go You guys always leave things lying around, I simply can't take it.",},
  [1642]={ID=1642,Key="Story_city3_dialog3_4",Cn="看，有了这张矮桌，以后你们的屋子就会整洁多了。",En="With this table, the house will be much tidier from now on.",},
  [1643]={ID=1643,Key="Story_city3_dialog3_2",Cn="谢谢你，宝贝儿，你真是太体贴了。顺便一问，你看到我的锤子了吗？",En="Thank you, my dear. That's very thoughtful of you. By the way, have you seen my hammer?",},
  [1644]={ID=1644,Key="Story_city3_dialog3_3",Cn="当然，刚才我还在用它钉……等等，我把锤子放在哪儿了？！",En="Of course, I was just using it to nail... Wait, where did I put it?",},
  [1645]={ID=1645,Key="Story_city3_dialog9_1",Cn="你在盯着炉子想什么？",En="what are you thinking as you stare at the stove?",},
  [1646]={ID=1646,Key="Story_city3_dialog9_2",Cn="我记得我在书上看到过发动机的原理。",En="I remember reading about the principles of steam engines.",},
  [1647]={ID=1647,Key="Story_city3_dialog9_3",Cn="嗯……如果你有足够的<color=\"\"#0b993c\"\">零件和铸件</color>，没准能在<color=\"\"#0b993c\"\">机械工厂</color>鼓捣出一台<color=\"\"#0b993c\"\">发动机</color>。",En="Well... If you have enough <color=\"\"#0b993c\"\">Link and Cylinders</color>， you can whip up a <color=\"\"#0b993c\"\">Steam Engine</color> in <color=\"\"#0b993c\"\">Machinery Factory</color>.",},
  [1648]={ID=1648,Key="Story_city3_dialog9_4",Cn="太棒了，这正是我们需要的",En="Amazing, that's exactly what we need.",},
  [1649]={ID=1649,Key="Story_city3_dialog9_5",Cn="知道矿上的同事们都怎么称呼我吗？“巧手玛尔达”！",En="You know what they used to call me at the mine? \"Handyman James\"",},
  [1650]={ID=1650,Key="Tutorial_EventAssignCard_notice",Cn="现在哈尼根开始管理小麦田",En="Gianluca starts managing the wheat field",},
  [1651]={ID=1651,Key="Story_city1_dialog4_1",Cn="木材生产的太多了，仓库已经放不下了。",En="Too much wood has been produced, and the warehouse can't hold it anymore.",},
  [1652]={ID=1652,Key="Story_city1_dialog4_2",Cn="那就把多余的木材加工成木板吧，",En="Let's process the excessive wood into planks.",},
  [1653]={ID=1653,Key="Story_city1_dialog4_3",Cn="比起木材，木板更适合我们加固生活设施。",En="Compared with wood, planks are more suitable for us to strengthen living facilities.",},
  [1654]={ID=1654,Key="Story_city1_dialog4_4",Cn="好主意，这样我就能有个带天花板的住处了。",En="Good idea, then I can have a proper house with a proper roof.",},
  [1655]={ID=1655,Key="Story_city1_dialog5_1",Cn="夏洛特，我好像听说过你和你的组织……你是不是有个外号叫“寡妇”？",En="Charlotte, I think I've heard of you and your organization... Do you go by the nickname, \"The Widow\"?",},
  [1656]={ID=1656,Key="Story_city1_dialog5_2",Cn="哈，你的消息可真灵通。",En="Ha, you're obviously well-informed.",},
  [1657]={ID=1657,Key="Story_city1_dialog5_5",Cn="这次，你的目标是谁？",En="Who's your target this time?",},
  [1658]={ID=1658,Key="Story_city1_dialog5_6",Cn="大卫，你猜人家的外号是怎么来的？",En="David, want to find out how I got my nickname?",},
  [1659]={ID=1659,Key="Story_city1_dialog5_7",Cn="呃，对不起，我不问了……求求你放下弓箭吧！",En="Uh, no, no, I apologize... Please put the bow and arrow down",},
  [1660]={ID=1660,Key="Story_city1_dialog5_8",Cn="这就对了。",En="Attaboy.",},
  [1661]={ID=1661,Key="Story_city1_dialog5_9",Cn="毕竟，姑娘们总得讨生活嘛~",En="After all, a girl's got to earn her living.",},
  [1662]={ID=1662,Key="Story_city1_dialog6_1",Cn="夏洛特，你为什么总在发呆？",En="Charlotte, why are you always looking off into space?",},
  [1663]={ID=1663,Key="Story_city1_dialog6_2",Cn="可能是患了思乡病吧。",En="I'm just homesick.",},
  [1664]={ID=1664,Key="Story_city1_dialog6_3",Cn="新迦南地？那个土著部落有什么好？",En="New Canaan Land? What's so great about that tribe?",},
  [1665]={ID=1665,Key="Story_city1_dialog6_4",Cn="俗话说得好，“金窝银窝不如自己的狗窝”。",En="As the saying goes, \"There's no place like home\".",},
  [1666]={ID=1666,Key="Story_city1_dialog6_5",Cn="那里毕竟是我的家乡，我的朋友们也在那里。",En="It is my hometown after all, and my friends are there.",},
  [1667]={ID=1667,Key="Story_city1_dialog6_6",Cn="你们的组织允许你们交朋友？",En="Are 'friends' allowed in your organization?",},
  [1668]={ID=1668,Key="Story_city1_dialog6_7",Cn="拜托，玛尔达，我们只是特工，不是“T-800”（终结者）什么的。",En="Come on, James, we're just operatives. It's not like we're killing machines or T-800s.",},
  [1669]={ID=1669,Key="Story_city1_dialog7_1",Cn="奥托，我想换一份工作了。",En="Otto, I applied to switch jobs.",},
  [1670]={ID=1670,Key="Story_city1_dialog7_2",Cn="为什么？",En="Why?",},
  [1671]={ID=1671,Key="Story_city1_dialog7_3",Cn="工作的时候，夏洛特总是让我紧张……那感觉就好像和一只剧毒的黑寡妇共处一室。",En="Charlotte makes me feel uncomfortable... I feel like I'm sharing a room with a black widow.",},
  [1672]={ID=1672,Key="Story_city1_dialog7_4",Cn="哈哈，玫瑰总是带刺的嘛。",En="Haha, well every rose has its thorns.",},
  [1673]={ID=1673,Key="Story_city4_dialog1_1_modified",Cn="看看这些山脉……里头肯定有丰富的矿石！",En="Look... These mountains must be rich in ore",},
  [1674]={ID=1674,Key="Story_city4_dialog1_2",Cn="铁锹扛起来吧兄弟们！",En="Pick the shovels up, guys",},
  [1675]={ID=1675,Key="Story_city4_dialog1_3",Cn="让我看看这是什么……是铜啊，我还以为……",En="Let me see what this is... It's copper, but I assumed...",},
  [1676]={ID=1676,Key="Story_city4_dialog1_4",Cn="以为是金子吗哈哈，铜也很好，可以做很多东西。现在这世道，金子也不过是石头罢了。",En="Did you think it was gold? Haha, copper is also good and it can be used for many things. In today's world, gold is worthless.",},
  [1677]={ID=1677,Key="Story_city4_dialog2_1",Cn="我们的运气不错，谁能想到这里还有铜矿呢！",En="We are very lucky. Who would have thought that there is a copper mine here",},
  [1678]={ID=1678,Key="Story_city4_dialog2_2",Cn="如果是金子就好了。",En="If only it had been gold...",},
  [1679]={ID=1679,Key="Story_city4_dialog2_3",Cn="眼下，金子对我们可没什么用处。",En="Right now, gold can't be of much use to us.",},
  [1680]={ID=1680,Key="Story_city4_dialog2_4",Cn="当然有——它能让我心情愉快。",En="Of course it can – it'd give me in a good mood.",},
  [1681]={ID=1681,Key="Story_city4_dialog7_1",Cn="站岗辛苦了。需要来杯热茶吗？",En="Good job, guard. Can I get you a cup of hot tea?",},
  [1682]={ID=1682,Key="Story_city4_dialog7_2",Cn="好，我得打起精神来。",En="Sure, I've got to buck up.",},
  [1683]={ID=1683,Key="Story_city4_dialog7_3",Cn="我们的警备很完善。你可以放轻松一点。",En="We're well secured. You can get some rest.",},
  [1684]={ID=1684,Key="Story_city4_dialog7_4_modified",Cn="这个世道，放松的代价可是很大的。",En="These days, the price of relaxation might be very high.",},
  [1685]={ID=1685,Key="Story_city4_dialog7_5",Cn="说得对。我也赶紧去干活了。",En="You're right. I must rush off to work too.",},
  [1686]={ID=1686,Key="Story_city4_dialog7_6",Cn="一起加油吧。",En="Let’s do our best together.",},
  [1687]={ID=1687,Key="Story_city4_dialog8_1",Cn="听说以前你经常走南闯北，什么东西都能弄来？",En="I heard that you used to travel a lot and could get anything?",},
  [1688]={ID=1688,Key="Story_city4_dialog8_2_modified",Cn="以前是，不过现在不一样了，现在我连个小事都搞不定。",En="Used to, but not anymore. Now I can't even manage a small thing.",},
  [1689]={ID=1689,Key="Story_city4_dialog8_3",Cn="什么事？",En="What's up?",},
  [1690]={ID=1690,Key="Story_city4_dialog8_4_modified",Cn="比如让厨师把土豆做得好吃一点，我都快吃吐了！",En="Like, if I ask the chef to make the potatoes more delicious, I fill sick",},
  [1691]={ID=1691,Key="Story_city4_dialog8_5",Cn="哈哈哈，恐怕没有人能做到这一点。有啥吃啥吧。",En="Hahaha, I'm afraid no one can do that. Eat what you have.",},
