  [1736]={ID=1736,Key="tooltip_Fun_not_enough",Cn="<color=#b41212><size=20>%s</size></color> <color=#3a3837><size=20>名幸存者</size></color> <color=#b412120><size=24>不开心</size></color>",En="<color=#b41212><size=20>%s</size></color> <color=#3a3837><size=20> survivors are </size></color> <color=#b41212><size=24>unhappy</size></color>",},
  [1737]={ID=1737,Key="UI_Job_Fisher",Cn="渔夫",En="Fisherman",},
  [1738]={ID=1738,Key="Tutorial_EventEnterCity_1002_dialogue_1",Cn="那时候气温还没有变冷，反常的高温持续了几年",En="The temperature hadn't started cooling back then and the abnormally high temperatures lasted for several years",},
  [1739]={ID=1739,Key="Tutorial_EventEnterCity_1002_dialogue_2",Cn="冰川融化后，海平面上升淹没城市",En="After the glaciers melted, the sea level rose and flooded the city",},
  [1740]={ID=1740,Key="Tutorial_EventEnterCity_1002_dialogue_3",Cn="我们在海面重建家园，专家和工人们养殖水产品",En="We rebuilt our homes on the surface while experts and workers farmed sea products",},
  [1741]={ID=1741,Key="Tutorial_EventEnterCity_1002_dialogue_4",Cn="海面生活虽然辛苦，但食宿无忧，每一天都充满希望",En="Life at sea was hard, but our food and shelter were free and each day was full of hope",},
  [1742]={ID=1742,Key="Tutorial_EventAssignCard_1002_notice",Cn="每个养殖场都有专家照看，指导工人生产",En="Experts looked after each farm, guiding the workers",},
  [1743]={ID=1743,Key="Tutorial_EventEnoughFood_1002_dialogue_1",Cn="水产品养殖起步艰难，但发展很快",En="Fish farming was tough at the start, but it grew fast",},
  [1744]={ID=1744,Key="Tutorial_EventEnoughFood_1002_dialogue_2",Cn="我们每天都有充足的海鲜食用",En="We had plenty of seafood to eat every day",},
  [1745]={ID=1745,Key="Tutorial_EventWarehouse_1002_dialogue_1",Cn="那个时候，人们不用担心自己被冻死，但也得关心一个东西——钱。",En="In those days, people needn't worry about freezing to death. They only had one thing to care about - money.",},
  [1746]={ID=1746,Key="Tutorial_EventWarehouse_1002_dialogue_2",Cn="人们需要付出劳动赚钱，也花钱购买自己需要的东西。",En="People exerted their efforts on labor to earn money, spending it on the things they needed.",},
  [1747]={ID=1747,Key="Tutorial_EventWarehouse_1002_dialogue_3",Cn="我们需要把养殖的水产品卖钱，购买机器来扩大生产",En="We sold the fish we farmed to buy machines to expand production",},
  [1748]={ID=1748,Key="Tutorial_EventWarehouse_1002_tips_1",Cn="购买更多的货船，卖出更多的水产品赚钱",En="We bought more cargo ships to sell more fish products and make more money",},
  [1749]={ID=1749,Key="Tutorial_EventSlot_1002_dialogue_1",Cn="养殖水产品不仅需要提升养殖技术",En="Farming sea products required us to improve our farming techniques",},
