  [1988]={ID=1988,Key="update_mail_1_title",Cn="补偿",En="Compensation",},
  [1989]={ID=1989,Key="update_mail_1_text",Cn="\"亲爱的幸存者，为了给您提供更好的游戏体验，我们在本次更新中进行了以下调整：\n1. 改变了家具的升级机制；由于此条改动，您可能会发现您的部分家具等级有所变动。\n2. 在建筑面板中增加了关键信息显示。\n3. 其他优化。\n请领取我们为您准备的更新赔偿 :)\n感谢大家一直以来的支持，同时，注意保暖！\n冰封时代团队\"",En="\"Dear Survivors.To provide you with a better gaming experience, we've made the following adjustments in this update:\n1. Adjusted the mechanics of furniture upgrade; you may find some of your furniture's levels changed due to this adjustment.\n2. Added key info display to the building panel.\n3. Other optimizations.\nPlease claim the compensation we've prepared for you below :)\nThank you all for your continued support, and stay warm\nFrozen City team\"",},
  [1990]={ID=1990,Key="update_mail_2_title",Cn="全新宝箱",En="New Chests",},
  [1991]={ID=1991,Key="update_mail_2_text",Cn="\"亲爱的冰雪幸存者，\n本次更新我们修改了抽卡方式，为您准备了全新的商店宝箱。\n我们将会把您账户中的宝箱替换成等价值的全新宝箱。\n谢谢您对我们游戏一直以来的喜爱。\n注意保暖\n冰封时代团队\"",En="\"Dear Survivors\nWe have modified the way to obtain heroes and please check the details below: \n- New chests:   You can obtain heroes, Wishing Stars and Blazing Stars from the new chest. \n- Tasks:   You can also obtain heroes by completing tasks. \nWe have replaced the chests in your account with new chests of equal value. Hope you enjoy \nFrozen City team\"",},
