  [2232]={ID=2232,Key="UI_delect_iOS_account_desc",Cn="自2022年6月30日起，iOS用户可以在应用内进行账号删除，有以下注意事项：1.当您删除账号时，账号的相关信息也将被删除；2.我们会在一个月的时间内完成您的账号删除操作，并且在删除完成后通知您；3.在处理您的账号前，您需要提供一些信息，包括个人信息、邮箱、电话号码等，用于验证您的身份。4.自动续费的订阅账单将持续到您取消该订阅为止；5.我们可在以下情形中保留您的个人信息：(a)符合法律程序的执法请求，(b)遵守法律义务，(c)用于科学或历史研究目的，(d) 其他法律允许并向您告知的情形；6.删除的账号将无法恢复。关于如何行使您对个人数据的其他权利的信息，请参阅我们的隐私政策 (https://www.centurygames.com/privacy-policy/)。",En="\"From June 30, 2022, for our iOS users, you may request the deletion of your account from within our application. Please be noted that: A.When you request the deletion of your account, relevant information will also be deleted. B.We will complete the deletion of your account as promptly as possible. Usually, it will not take longer than one month. You will get notified when it’s finished. C.Before processing your request, we may require specific information from you in order to help us verify your identity. This can include personal information, your email, phone number, etc. D.Billing for auto-renewable subscriptions will continue until you cancel the subscription. E.We may retain personal information only when necessary to: (a) comply with law enforcement requests pursuant to lawful process, (b) to comply with legal obligations, (c) for scientific or historical research,or (d) otherwise as permitted by law and disclosed to you when we respond to your request. F.Deleted accounts cannot be recovered.As for information regarding how to exercise your other rights on personal data, please refer to our Privacy Policy (https://www.centurygames.com/privacy-policy/).\"",},
