  [2336]={ID=2336,Key="Tutorial_EventIntro_2001_dialogue_1",Cn="好冷呀，我得去烤烤火",En="It’s freezing, I need to warm myself by the fire.",},
  [2337]={ID=2337,Key="Tutorial_EventIntro_2001_dialogue_2",Cn="雪好像越来越大了......",En="The snow is getting even heavier...",},
  [2338]={ID=2338,Key="Tutorial_EventIntro_2001_dialogue_3",Cn="唉，从那年开始雪就没停过",En="What can we do, the snow has not stopped since that fateful year.",},
  [2339]={ID=2339,Key="Tutorial_EventIntro_2001_dialogue_4",Cn="你们还记得那年秋天吗？",En="Still remember that last autumn?",},
  [2340]={ID=2340,Key="Tutorial_EventEnterCity_dialogue_2001_1",Cn="那年的雪来的特别突然，本来以为只是冬天提前到了",En="It started snowing just like that, everyone thought the winter just came a bit earlier than usual.",},
  [2341]={ID=2341,Key="Tutorial_EventEnterCity_dialogue_2001_2",Cn="没想到冬天就再也没结束......",En="No one knew the dreaded winter was here to stay...",},
  [2342]={ID=2342,Key="Tutorial_EventLightFire_dialogue_2001_1",Cn="趁着大地还没被完全冻住，抓紧开始建设避难所",En="We started building the shelters before the ground got all frozen up",},
  [2343]={ID=2343,Key="Tutorial_EventEnterCity_dialogue_2001_4",Cn="今天一定要多砍点儿木头，晚上把火烧旺点儿",En="We must chop more wood today and burn a bigger fire at night.",},
