  [2360]={ID=2360,Key="rogue_intro",Cn="\"选择卡牌来进行探索：\n1.在能量耗尽以前尽可能前进，来获取更多的资源；\n2.选择人员来补充你的队伍，让他们能击败遇到的敌人；\n3.每经过一个事件，你会获得宝箱进度，开启宝箱可以任选一张卡牌.\"",En="Select the cards to start an exploration:\n1. Advance as far as possible before running out of energy to claim more resources.\n2. Choose the personnel to replenish your team so they can defeat any enemies they encounter.\n3. After each event, you will obtain chest progress. Open a chest to choose any unlocked Hero.",},
