  [2457]={ID=2457,Key="ClauseInfo_title",Cn="适龄提示",En="Age-appropriate tips",},
  [2458]={ID=2458,Key="ClauseInfo_info",Cn="（1）本游戏是一款末日写实模拟经营类游戏，适用于年满16周岁及以上的用户，建议未成年人在家长监护下使用游戏产品。\n（2）本游戏以末日题材，基于末世生存模拟经营玩法，设有轻松简单的养成和关卡玩法，鼓励玩家用心钻研和挑战自我。\n（3）根据国家相关要求，本游戏中有用户实名认证系统，未通过实名认证的用户不可进入游戏，认证为未成年人的用户将接受以下管理：\n认证为未成年人的用户，除周五、周六、周日及法定节假日每日20时至21时外，其他时间均不可进入游戏。\n游戏中部分玩家和道具需要付费。未满8周岁的用户不能付费；8周岁以上未满16周岁的未成年人用户，单次充值金额不得超过50元人民币，每月充值金额累计不得超过200元人民币；16周岁以上的未成年人用户，单次充值金额不得超过100元人民币，每月充值金额累计不得超过400元人民币。\n（4）本游戏以末日生存为主题，可以提供玩家建设，培养，闯关，资源搭配的过程，有助于玩家日常放松。游戏玩法简单，能够带给玩家积极愉悦的情绪体验，增强玩家的自信心。",En="(1) This game is a post-apocalyptic realistic simulation business game. It is suitable for users aged 16 and above. It is recommended that minors use game products under the supervision of their parents.\n(2) This game has a post-apocalyptic theme and is based on apocalyptic survival simulation management gameplay. It has easy and simple development and level gameplay to encourage players to study hard and challenge themselves.\n(3) According to relevant national requirements, this game has a user real-name authentication system. Users who have not passed the real-name authentication are not allowed to enter the game. Users who are certified as minors will be subject to the following management:\nUsers certified as minors are not allowed to enter the game at any time except 20:00 to 21:00 every day on Friday, Saturday, Sunday and legal holidays.\nSome players and props in the game require payment. Users under 8 years old cannot pay; minor users over 8 years old but under 16 years old, the single recharge amount shall not exceed RMB 50, and the cumulative monthly recharge amount shall not exceed RMB 200; minors over 16 years old Users, the single recharge amount shall not exceed RMB 100, and the cumulative monthly recharge amount shall not exceed RMB 400.\n(4) With the theme of doomsday survival, this game can provide players with the process of building, training, completing levels, and resource allocation, which helps players relax in their daily life. The gameplay is simple, can bring players a positive and pleasant emotional experience, and enhances players' self-confidence.",},
